==Trivia==
* His name is a reference to {{Wp|Trent Reznor}}, the frontman of Nine Inch Nails.{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/1159008574707851265|date=07 August 2019|archiveurl=https://archive.is/iBarw|archivedate=30 May 2020|quote=The dev is no longer here to ask, but I believe he confirmed that it is indeed such a reference when he still worked here.}}
* In the [[Transcript:Baba Yaga, Hill Giants and correct pronunciation!|11th issue]] of the [[Postbag from the Hedge]], his moniker is revealed to be "Treznor the Grubby".

